import React from 'react';
import { Flex, Button, Stack } from '@chakra-ui/core';
import {
  Modal,
  ModalContent,
  ModalHeader,
  ModalFooter,
  ModalBody,
  useDisclosure,
  Box,
} from '@chakra-ui/core';
export default function Home(props: any) {
  const { isOpen, onOpen, onClose } = useDisclosure();

  return (
    <>
      <Flex width={['100%']} height={['100vh']} align="center" justify="center">
        <Flex align="center" justify="center">
          <Stack spacing={5}>
            <Box>Try to beat the high score!</Box>
            <Button
              onClick={() => onOpen()}
              variantColor="blue"
              variant="outline"
              _hover={{ border: '1px solid blue' }}
              _focus={{ outline: 'none' }}
            >
              Start
            </Button>
            <Button
              onClick={() => props.setView('highscore')}
              color="gold"
              variant="outline"
              _hover={{ border: '1px solid yellow' }}
              _focus={{ outline: 'none' }}
            >
              Highscore
            </Button>
          </Stack>
        </Flex>
        <Modal isCentered isOpen={isOpen} onClose={onClose} closeOnEsc>
          <ModalContent
            border="5px solid gold"
            backgroundColor="black"
            borderRadius="10px"
            height="600px"
            opacity={1}
          >
            <Flex
              width={['100%']}
              height={['100vh']}
              align="center"
              justify="center"
            >
              <Flex
                // p={10}
                align="center"
                justify="center"
                border="5px solid gold"
                borderRadius="10px"
              >
                <Stack spacing={5} height="600px" width="400px">
                  <Box
                    height="35px"
                    textAlign="center"
                    backgroundColor="gold"
                    color="black"
                  >
                    Highscore
                  </Box>
                  <Box height="485px">
                    {props.isNewHighscore && (
                      <Flex
                        align="center"
                        justify="space-evenly"
                        direction="row"
                        p={2}
                      >
                        <Box width="75px" textAlign="center">
                          {props.newScore}
                        </Box>
                        <Input
                          autoFocus
                          width="120px"
                          variant="unstyled"
                          textAlign="center"
                          mx={5}
                          maxLength={8}
                          borderBottom="1px solid white"
                          value={username}
                          onKeyDown={(e: any) => {
                            if (
                              e.key === 'Enter' &&
                              e.target.value.trim().length > 0
                            ) {
                              handleSave();
                            }
                          }}
                          onChange={(e: any) =>
                            setUsername(e.target.value.trim())
                          }
                        />
                        <Box width="150px" textAlign="center">
                          {convertDate(new Date())}
                        </Box>
                      </Flex>
                    )}
                    {highscores.map((highscore: any) => {
                      return (
                        <Flex
                          key={highscore._id}
                          align="center"
                          justify="space-evenly"
                          direction="row"
                          p={2}
                        >
                          <Box width="75px" textAlign="center">
                            {highscore.score}
                          </Box>
                          <Box mx={5} width="120px" textAlign="center">
                            {highscore.username}
                          </Box>
                          <Box width="150px" textAlign="center">
                            {convertDate(highscore.createdAt)}
                          </Box>
                        </Flex>
                      );
                    })}
                  </Box>
                  <Flex
                    align="center"
                    justify="space-evenly"
                    direction="row"
                    backgroundColor="gold"
                  >
                      <Button
                        variant="ghost"
                        color="black"
                        _hover={{ border: 'none', color: 'grey' }}
                        _focus={{ outline: 'none' }}
                      >
                        Save
                      </Button>
                    )}x
                    <Button
                      onClick={() => {
                        props.setIsNewHighscore(false);
                        props.setView('home');
                      }}
                      variant="ghost"
                      color="black"
                      _hover={{ border: 'none', color: 'grey' }}
                      _focus={{ outline: 'none' }}
                    >
                      Cancel
                    </Button>
                  </Flex>
                </Stack>
              </Flex>
            </Flex>
          </ModalContent>
        </Modal>
      </Flex>
    </>
  );
}
